contract CreateEscrowV2Contract {}

contract EscrowV2 {
    address public buyer;
    address public seller;
    address public arbiter;
    uint256 public depositDate;
    uint256 public duration;
    bool public alreadyDeposited;

    constructor(
        address _buyer,
        address _seller,
        address _arbiter,
        uint256 _duration
    ) {}

